object.script:
local triggered_inputs = {}
local only_once = property.getBool("Each input can only be triggered once?")
function onTick() for i = 1, 32 do if input.getBool(i) and (not only_once or not triggered_inputs[i])then output.setBool(1, true) triggered_inputs[i] = true return end end output.setBool(1, false) end
